// Process all incoming items

return $input.all().map(item => {
  const html = item.json.html; // adjust if your field name differs

  const comerce = html.match(/<p>\s*Comercio:<\/p>\s*<\/td>\s*<td[^>]*>\s*<p>\s*([^<]+)/i)?.[1]?.trim();
  const date = html.match(/<p>\s*Fecha:<\/p>\s*<\/td>\s*<td[^>]*>\s*<p>\s*([^<]+)/i)?.[1]?.trim();
  const location = html.match(/<p>\s*Ciudad y pa&iacute;s:<\/p>\s*<\/td>\s*<td[^>]*>\s*<p>\s*([^<]+)/i)?.[1]?.trim().replace(',', '.');
  const amount = html.match(/<p>\s*Monto:<\/p>\s*<\/td>\s*<td[^>]*>\s*<p>\s*([^<]+)/i)?.[1]?.trim()?.replace(',', '.');

  return {
    json: {
      comerce,
      date,
      amount,
      location
    }
  };
});

// Merge all previous items into one array
return [
  {
    json: {
      expenses: $input.all().map(item => item.json)
    }
  }
];

